import {FaLocationArrow, FaMobileAlt, FaEnvelope } from "react-icons/fa";
import Payment from "../../assets/payments.png";
import "./Footer.scss";
const Footer = () => {
    return <footer className="footer">
        <div className="footer-content">
            <div className="col">
                <div className="title">About</div>
                <div className="text">Volumtatem accoustanin dolerume lumutanin, totam rems
                aperiam, eaque ipsa quae dangular en stri to kuliam te mutanoitn erte
                quasi architecto behate batatin dicta. </div>
            </div>
            <div className="col"><div className="title"> About</div> </div>
            <div className="col">col3</div>
            <div className="col">col4</div>
        </div>
    </footer>
};

export default Footer;
